import {BrowserRouter,Routes,Route} from "react-router-dom";
import { useState } from "react";
import Form from "./home/Form";
import Home from "./home/home";
function App() {
  return (
    <BrowserRouter>
    <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/form' element={<Form/>}/>

    </Routes>
    </BrowserRouter>
  );
}

export default App;
